#ifndef _local_sequence_alignment_h_
#define _local_sequence_alignment_h_

#include "dimensions.h"
#include "simulation.h"
#include "seq_generator.h"
#include <string.h>
#include <string>

/*===========================================================================*/
/*--- Local Sequence Alignment class ---*/

class LSA : public Simulation
{
 public:
  /*=============================================*/
  /*=== MANDATORY FUNCTIONS ===*/
  /*=============================================*/

  /*--- Constructor ---*/
  LSA() {
    printf("Default Constructor. DO NOT USE. This does not pass along simulation dimensions!\n\n");
    exit(0);
  }  

  LSA(Dimensions d);

  /*--- Initialization ---*/
  void init();

  /*--- Run ---*/
  /*--- This should run your wavefront sweep component & in-gridcell computation ---*/
  void run();

  /*--- Print Output ---*/
  void print();

  int r();
  int c();
 private:
  /*=============================================*/
  /*=== ALGORITHM-SPECIFIC FUNCTIONS ===*/
  /*=============================================*/

  /*--- Create sequence alignment scoring matrix ---*/
  void create_score_matrix(int rows, int cols);

  int calc_score(int x, int y);

  /*=============================================*/
  /*=== DATA ===*/
  /*=============================================*/
  // These scores are taken from Wikipedia.
  // en.wikipedia.org/wiki/Smith%E2%80%93Waterman_algorithm
  int rows, cols, matrix_size;
  int match = 2;
  int mismatch = -1;
  int gap = -1;
  char* seq1_cstr = "";

  char* seq2_cstr = "";
  std::string seq1="";
  std::string seq2="";

  /*--- Smith Waterman scoring matrix ---*/
  int* __restrict__ matrix;
};

#endif /*--- _local_sequence_alignment_h_ ---*/

